import React from 'react';

import Router from 'next/router'
import Link from 'next/link';    


const Users = (props)=>
(
<div>
<h1>Main Pages </h1>

<p>Go To
<Link href="/Auth" >
    <a>  Auth</a>
  </Link></p>

  <button onClick={()=>Router.push('/Auth')}> Go to Auth</button>
</div>
    );


export default Users;
